import React,{ Component } from 'react';
import './App.css';
import Logged from './components/Model';

// import {
//   BrowserRouter as Router,
//   Route,
//   Link
// } from 'react-router-dom'


export default class App extends Component {
  state={
    title:['Critical Hit','Critical Hit','Critical Hit','Critical Hit'],
    url:['http://placehold.it/300x300','http://placehold.it/300x300','http://placehold.it/300x300','http://placehold.it/300x300'],
    train_score:[0.8,0.7,0.8,0.7],
    test_score:[0.9,0.95,0.9,0.95],
  }
  render() {
    const info=this.state.title.map((item,index)=>{
      return <Logged url={this.state.url[index]} title={this.state.title[index]} train_score={this.state.train_score[index]} test_score={this.state.test_score[index]} />
    })
    return (
      <div>
      <nav className='bg-dark navbar-expand-lg text-right p-1'>
        <a href="#null" className='text-white'>Login</a>
      </nav>
      {info}
      <div className='col-12 col-sm-6 col-md-4 card_model'>
      <div className="card border-success mb-3">
          <h4 className="card-header text-center">{this.props.title}</h4>
          <img src={this.props.url} alt="" className='img_model'/>
          <h6 className='text-left'>Train R2 Score: {this.props.train_score}</h6>
          <h6 className='text-left'>Test R2 Score: {this.props.test_score}</h6>
        </div>
      </div>
      </div>
    )
  }
}
